import React from 'react';
import './App.css';

import Header from './components/Header';
import Categories from './components/Categories';
import MainCart from './components/MainCart';
import Burgers from './components/Burgers';
import Footer from './components/Footer';

import burgers from '/burgers.json';

console.log(burgers);

function App() {
  return (
    <div className="App">
      <Header />
      <Categories />
      <div className="main">
        <MainCart title="Мексиканская" price={500} weight={300}/>
      <div className="content_food">
        <h3>Бургеры</h3>
          <div className="burgers">
            <Burgers title="Мексиканская" price={500} weight={300} />
            <Burgers />
            <Burgers />
            <Burgers />
            <Burgers />
            <Burgers />
          </div>
       </div>
      </div>
        <Footer />
      </div>
  );
}

export default App;
